    <h3> {gender}</h3>
    <h3> {seed}</h3>
    </div>

    <table>
          <thead>
            <tr>
              <th>Time </th>
              <th>Price</th>
              <th>Amount</th>
            </tr>
          </thead>
          <tbody>
            {orders.map(({ gender, name, seed }, i) => (
              <tr key={i}>
                <td> {gender} </td><td>{name}</td><td>{seed}</td>
              </tr>
            ))}
          </tbody>
        </table>
    </div>
    )
}
